import React from "react";
import Navbar from "./Navbar";
import Footer from "./Footer";

const AppLayout = (props) => {
  const { content } = props;

  return (
    <div className="app-layout">
      <header>
        <Navbar />
      </header>

      <main>
        {content}
      </main>

      <footer>
        <Footer />
      </footer>
    </div>
  );
};

export default AppLayout;
